import React from 'react'
import { Link } from 'react-router-dom'


export default () => {
    return (
        <>
            <h1>IronBeers</h1>
            <Link to="/beers"></Link>
            <Link to="/random-beer"></Link>
            <Link to="/new-beer"></Link>
        </>
    )
}
